import React from "react";

export const Introduction = () => {
  return (

    <div style={{textAlign: 'left', paddingLeft: '235px', marginTop: '-100px'}}>
      <h4>
        Problem
      </h4>
      <ul style={{fontSize: '30px', paddingLeft: '70px', marginTop: '20px'}}>
        <li style={{wordWrap: 'break-word', wordBreak: 'break-all'}}>Given pitch-by-pitch level data, we want to rate the quality of each pitch thrown in the MLB</li>
        <li style={{wordWrap: 'break-word', wordBreak: 'break-all'}}>After rating the quality of a pitch, we can group by the pitcher and “grade” pitchers compared to others pitchers in the MLB</li>
        <li style={{wordWrap: 'break-word', wordBreak: 'break-all'}}>By analyzing the grades that each pitcher has and how certain variables interact to raise or lower the quality of a pitch, we can then offer individualized recommendations about how they might improve their overall repertoire</li>
      </ul>
    </div>

  );
};
